import{_ as e,o as a,c as r,a as l}from"./app.e8b008f9.js";const t=JSON.parse('{"title":"创建运行时环境","description":"","frontmatter":{"outline":"deep"},"headers":[{"level":2,"title":"安装部署","slug":"安装部署","link":"#安装部署","children":[]},{"level":2,"title":"注册部署运行时集群","slug":"注册部署运行时集群","link":"#注册部署运行时集群","children":[]},{"level":2,"title":"提交产品配置清单","slug":"提交产品配置清单","link":"#提交产品配置清单","children":[]},{"level":2,"title":"提交部署配置清单","slug":"提交部署配置清单","link":"#提交部署配置清单","children":[]},{"level":2,"title":"跟踪部署过程和结果","slug":"跟踪部署过程和结果","link":"#跟踪部署过程和结果","children":[]}],"relativePath":"guide/user-guide/quickstart-01.md"}'),s={name:"guide/user-guide/quickstart-01.md"},i=[l('<h1 id="创建运行时环境" tabindex="-1">创建运行时环境 <a class="header-anchor" href="#创建运行时环境" aria-hidden="true">#</a></h1><p>本文档将描述创建部署运行时的执行过程。包括以下步骤：<br><a href="#%E5%AE%89%E8%A3%85%E9%83%A8%E7%BD%B2">安装部署</a><br><a href="#%E6%B3%A8%E5%86%8C%E9%83%A8%E7%BD%B2%E8%BF%90%E8%A1%8C%E6%97%B6%E9%9B%86%E7%BE%A4">注册部署运行时集群</a><br><a href="#%E6%8F%90%E4%BA%A4%E4%BA%A7%E5%93%81%E9%85%8D%E7%BD%AE%E6%B8%85%E5%8D%95">提交产品配置清单</a><br><a href="#%E6%8F%90%E4%BA%A4%E9%83%A8%E7%BD%B2%E9%85%8D%E7%BD%AE%E6%B8%85%E5%8D%95">提交部署配置清单</a><br><a href="#%E8%B7%9F%E8%B8%AA%E9%83%A8%E7%BD%B2%E8%BF%87%E7%A8%8B%E5%92%8C%E7%BB%93%E6%9E%9C">跟踪部署过程和结果</a></p><h2 id="安装部署" tabindex="-1">安装部署 <a class="header-anchor" href="#安装部署" aria-hidden="true">#</a></h2><p>详情参见 <a href="./quickstart-03.html">安装部署</a>。</p><h2 id="注册部署运行时集群" tabindex="-1">注册部署运行时集群 <a class="header-anchor" href="#注册部署运行时集群" aria-hidden="true">#</a></h2><p>待补充。</p><h2 id="提交产品配置清单" tabindex="-1">提交产品配置清单 <a class="header-anchor" href="#提交产品配置清单" aria-hidden="true">#</a></h2><p>通过 Nautes CLI 提交产品、环境、项目、代码库、部署运行时等资源文件，这些资源文件组成了“产品配置清单”。提交成功后，将根据产品配置清单向部署运行时集群实施自动部署，以安装产品的部署运行时环境。</p><ol><li><p>克隆 <a href="https://gitlab.bluzin.io/nautes-labs/cli.git" target="_blank" rel="noreferrer">产品配置库模板</a> 的代码库，相对路径为“examples/demp.yaml”，批量替换产品配置库模板中的变量 suffix。</p></li><li><p>下载 <a href="https://gitlab.bluzin.io/nautes-labs/cli.git" target="_blank" rel="noreferrer">命令行工具</a>，执行以下命令。其中，“examples/demo.yaml” 指在产品配置库模板的代码库中的相对路径，gitlab-access-token 是您的 GitLab 访问令牌，api-server-address 是 <a href="./quickstart-03.html#查看组件信息">Nautes API Server 的访问地址</a>。执行成功后，将生成产品配置清单，并自动安装产品的部署运行时环境。</p></li></ol><div class="language-Shell"><button class="copy"></button><span class="lang">Shell</span><pre><code><span class="line"><span style="color:#A6ACCD;">nautes apply -f examples/demo.yaml -t </span><span style="color:#89DDFF;">$</span><span style="color:#A6ACCD;">gitlab-access-token -s </span><span style="color:#89DDFF;">$</span><span style="color:#A6ACCD;">api-server-address</span></span>\n<span class="line"></span></code></pre></div><h2 id="提交部署配置清单" tabindex="-1">提交部署配置清单 <a class="header-anchor" href="#提交部署配置清单" aria-hidden="true">#</a></h2><p>通过 Git CLI 提交产品的部署配置清单，例如 deployment、service、volume 等资源。提交成功后，部署配置清单将同步到产品的部署运行时环境，并执行部署。详情参考 <a href="https://docs.gitlab.com/ee/tutorials/make_your_first_git_commit.html" target="_blank" rel="noreferrer">GitLab</a>。</p><h2 id="跟踪部署过程和结果" tabindex="-1">跟踪部署过程和结果 <a class="header-anchor" href="#跟踪部署过程和结果" aria-hidden="true">#</a></h2><p>在部署产品的过程中或部署完成后，可以通过 ArgoCD 控制台或者 kubectl 命令行来跟踪部署过程和结果。这两种方式均支持单点登录，方便用户管理被授权的产品资源。详情参考 <a href="./user-guide-06.html">跟踪部署过程和结果</a>。</p>',14)];const n=e(s,[["render",function(e,l,t,s,n,h){return a(),r("div",null,i)}]]);export{t as __pageData,n as default};
